//SPDX-License-Identifier:MIT
pragma solidity ^0.8.13;

contract Primitives{
    bool public boo; //bool 是solidity中的逻辑符号（true/false），初始默认值是false

    uint8 public numa = 3; //uint8 是非负整数类型，最大值是 2**8-1；以此类推uint16 的 0 到 2**16-1

    uint public numb = 5654598944;  //uint 是uint256缩写（0，2**256-1)

    int8 public numi = -128; //int 是整数类型，最小值是 -2**7 最大值是 2**7-1

    int public numj = -2354545345641; //int 最小值是 -2**255 最大值是 2**255-1

    address public addr; //address 是地址

    uint public x;

    bytes1 public a = 0x7b;

    int public intmax = type(int).max; //通过内置的type函数获取当前的类型变量的最大值最小值
}

contracts/005Constants.sol.content:
// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.9;

contract Constants {
    // constant修饰符表示这个变量是不可修改的，这样存储的时候可以减少很多gas消耗
    // constant后面的值要大写
    address public constant MyAddress = 0x777788889999AaAAbBbbCcccddDdeeeEfFFfCcCc;
    uint256 public constant MyUint = 123;
}

contracts/006Immutable.sol.content:
// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.9;

contract Immutable{
    //变量前加了immutable修饰符说明他只能被construct这个初始化函数修改，然后就再也不能修改了
    //immutable后面的值要大写
    address public immutable My_ADDRESS;
    uint public immutable Numb;
    //constructor是指的是合约部署时跟着初始化的一个函数
    constructor(){
        My_ADDRESS = msg.sender;
        Numb = 200;
    }
}

contracts/007ReadAndWrite.sol.content:
// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.9;

contract SimpleStorage{
    uint public numa; //在区块链上部署了一个名为numa的变量 占用一个位置

    function set(uint _numa) public {
        numa = _numa;
    }

    function get() public view returns(uint){
        return numa;
    }
}

